import React, { useState } from "react"

const Banner = () => {
  const [showBanner, setShowBanner] = useState(false)

  return (
    <div>
      {showBanner && <p>Success!</p>}
      <button onClick={() => setShowBanner(!showBanner)}>Toggle Banner</button>
    </div>
  )
}

export default Banner
